import React from 'react'
import './Tile.css' 
export default function Tile(props) {
    var tiles = []
    var counter = 0;
    console.log(props.tileArr)
    props.tileArr.forEach(element => {
        tiles.push([])
        element.forEach(letter => {
            tiles[counter].push(<div className='singleTile'>{element}</div>)
        })
        counter++;
    });

  return (
    <div className='wholePiece'>{tiles}</div>
  )
}
